export default function Profile(props) {
  const userid = props.match.params.id;
  console.log(id, typeof id);
  return (
    <div>
      <h2>Profile 입니다.</h2>
      {userid && <p>id는 {userid} 입니다.</p>}
    </div>
  );
}
